import React from 'react';
import './Banner.css';

function Banner() {
    return (
        <div className="site-banner">
            <img src="tijolo.jpg"></img>
        <h1 className="site-banner-title">JY <br></br> MEDIA MARKETING</h1>
            </div>
      
      
    );
  }
  export default Banner;
